    "summary": "The recipe My Chicken Korman is ready <b>in about 45 minutes</b> and is definitely a tremendous <b>gluten free, dairy free, and whole 30</b> option for lovers of Indian food. For <b>$1.38 per serving</b>, you get a main course that serves 3. One serving contains <b>311 calories</b>, <b>20g of protein</b>, and <b>25g of fat</b>. 7 people were impressed by this recipe. A mixture of salt, oil, coriander powder, and a handful of other ingredients are all it takes to make this recipe so tasty. To use up the oil you could follow this main course with the <a href=\"https://spoonacular.com/recipes/vegan-mango-banana-bread-49650\">Vegan Mango Banana Bread</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 43%</b>. This score is good. Try <a href=\"https://spoonacular.com/recipes/vegetable-korma-how-to-make-veg-korma-487584\">vegetable korma , how to make veg korma</a>, <a href=\"https://spoonacular.com/recipes/chicken-korma-290978\">Chicken Korma</a>, and <a href=\"https://spoonacular.com/recipes/chicken-korma-217675\">Chicken Korma</a> for similar recipes.",
