    "summary": "Need a <b>gluten free, dairy free, and whole 30 main course</b>? Peri Peri Chicken and Savoury Rice could be an amazing recipe to try. This recipe makes 6 servings with <b>643 calories</b>, <b>40g of protein</b>, and <b>50g of fat</b> each. For <b>$1.64 per serving</b>, this recipe <b>covers 24%</b> of your daily requirements of vitamins and minerals. 336 people have made this recipe and would make it again. If you have sized lemon, chicken pieces, oregano, and a few other ingredients on hand, you can make it. To use up the ice cube you could follow this main course with the <a href=\"https://spoonacular.com/recipes/nectarine-blackberry-and-pecan-sundaes-50465\">Nectarine, Blackberry, and Pecan Sundaes</a> as a dessert. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 80%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/peri-peri-roast-chicken-with-new-potato-slaw-224251\">Peri-peri roast chicken with new potato slaw</a>, <a href=\"https://spoonacular.com/recipes/peri-peri-chicken-salad-with-charred-corn-801968\">Peri-Peri chicken salad with charred corn</a>, and <a href=\"https://spoonacular.com/recipes/grilled-peri-peri-chicken-thighs-918673\">Grilled peri-peri chicken thighs</a> for similar recipes.",
