    "summary": "Grilled Spareribs With Birmingham Bbq Sauce is a <b>gluten free and dairy free</b> main course. This recipe makes 6 servings with <b>1224 calories</b>, <b>59g of protein</b>, and <b>96g of fat</b> each. For <b>$3.16 per serving</b>, this recipe <b>covers 37%</b> of your daily requirements of vitamins and minerals. It can be enjoyed any time, but it is especially good for <b>The Fourth Of July</b>. 15 people have made this recipe and would make it again. If you have brown sugar, peanut oil, mustard, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes around <b>around 45 minutes</b>. It is brought to you by Foodista. All things considered, we decided this recipe <b>deserves a spoonacular score of 79%</b>. This score is solid. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/grilled-bbq-chicken-pizza-with-cherry-chipotle-bbq-sauce-475295\">Grilled BBQ Chicken Pizza, with Cherry Chipotle BBQ Sauce</a>, <a href=\"https://spoonacular.com/recipes/sweet-mesquite-bbq-spareribs-265836\">Sweet Mesquite BBQ Spareribs</a>, and <a href=\"https://spoonacular.com/recipes/fall-off-the-bone-oven-bbq-pork-spareribs-558651\">Fall-Off-The-Bone Oven BBQ Pork Spareribs</a>.",
