    "summary": "You can never have too many main course recipes, so give Avocado Egg Salad a try. One serving contains <b>379 calories</b>, <b>19g of protein</b>, and <b>11g of fat</b>. This recipe serves 1 and costs $1.52 per serving. 9 people have made this recipe and would make it again. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. A mixture of pepper, eggs, lemon, and a handful of other ingredients are all it takes to make this recipe so flavorful. To use up the ice cube you could follow this main course with the <a href=\"https://spoonacular.com/recipes/nectarine-blackberry-and-pecan-sundaes-50465\">Nectarine, Blackberry, and Pecan Sundaes</a> as a dessert. It is a good option if you're following a <b>dairy free and vegetarian</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 68%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/avocado-egg-salad-tea-sandwiches-910527\">Avocado Egg Salad Tea Sandwiches</a>, <a href=\"https://spoonacular.com/recipes/california-breakfast-wrap-avocado-egg-bacon-more-917552\">California Breakfast Wrap (Avocado, Egg, Bacon & More!)</a>, and <a href=\"https://spoonacular.com/recipes/healthy-egg-salad-sandwich-913169\">Healthy Egg Salad Sandwich</a> for similar recipes.",
