    "imageType": "jpg",
    "summary": "Easy Key Lime Pie is a <b>vegetarian</b> dessert. This recipe makes 8 servings with <b>481 calories</b>, <b>6g of protein</b>, and <b>32g of fat</b> each. For <b>97 cents per serving</b>, this recipe <b>covers 7%</b> of your daily requirements of vitamins and minerals. Head to the store and pick up whipped cream, egg yolks, condensed milk, and a few other things to make it today. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. 7 people have made this recipe and would make it again. All things considered, we decided this recipe <b>deserves a spoonacular score of 23%</b>. This score is not so excellent. Try <a href=\"https://spoonacular.com/recipes/macadamia-key-lime-pie-911117\">Macadamia Key Lime Pie</a>, <a href=\"https://spoonacular.com/recipes/3-1-2-inch-miniature-key-lime-pies-918319\">3 1/2 Inch Miniature Key Lime Pies</a>, and <a href=\"https://spoonacular.com/recipes/key-lime-hatch-chile-gelato-how-to-use-hatch-chiles-916609\">Key Lime Hatch Chile Gelato: How to Use Hatch Chiles</a> for similar recipes.",
