    "summary": "Glazed pork chops might be just the main course you are searching for. For <b>$2.07 per serving</b>, this recipe <b>covers 19%</b> of your daily requirements of vitamins and minerals. This recipe makes 4 servings with <b>461 calories</b>, <b>31g of protein</b>, and <b>32g of fat</b> each. 8 people have made this recipe and would make it again. A mixture of pork chops, honey, soy sauce, and a handful of other ingredients are all it takes to make this recipe so yummy. To use up the balsamic vinegar you could follow this main course with the <a href=\"https://spoonacular.com/recipes/skinny-strawberry-ice-cream-667869\">Skinny Strawberry Ice Cream</a> as a dessert. It is a good option if you're following a <b>gluten free and ketogenic</b> diet. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 55%</b>. This score is pretty good. Try <a href=\"https://spoonacular.com/recipes/glazed-pork-chops-82095\">Glazed Pork Chops</a>, <a href=\"https://spoonacular.com/recipes/glazed-pork-chops-for-2-382545\">Glazed Pork Chops for 2</a>, and <a href=\"https://spoonacular.com/recipes/glazed-pork-chops-822333\">Glazed Pork Chops</a> for similar recipes.",
