    "summary": "Enchiladas Verdes (Green Enchiladas) might be just the main course you are searching for. One portion of this dish contains about <b>30g of protein</b>, <b>20g of fat</b>, and a total of <b>445 calories</b>. This recipe serves 6. For <b>$1.72 per serving</b>, this recipe <b>covers 21%</b> of your daily requirements of vitamins and minerals. It is a <b>budget friendly</b> recipe for fans of Mexican food. It is brought to you by Foodista. Only a few people made this recipe, and 8 would say it hit the spot. Head to the store and pick up queso fresco, water, corn tortillas, and a few other things to make it today. From preparation to the plate, this recipe takes approximately <b>approximately 45 minutes</b>. With a spoonacular <b>score of 59%</b>, this dish is solid. Try <a href=\"https://spoonacular.com/recipes/enchiladas-verdes-con-pavo-green-chile-turkey-enchiladas-555668\">Enchiladas Verdes con Pavo (Green Chile Turkey Enchiladas)</a>, <a href=\"https://spoonacular.com/recipes/enchiladas-verdes-green-enchiladas-838461\">Enchiladas Verdes (Green Enchiladas)</a>, and <a href=\"https://spoonacular.com/recipes/enchiladas-verdes-26278\">Enchiladas Verdes</a> for similar recipes.",
