    "summary": "Wholemeal Cake could be just the <b>lacto ovo vegetarian</b> recipe you've been looking for. This recipe makes 4 servings with <b>432 calories</b>, <b>9g of protein</b>, and <b>27g of fat</b> each. For <b>65 cents per serving</b>, this recipe <b>covers 14%</b> of your daily requirements of vitamins and minerals. A couple people really liked this dessert. 10 people have made this recipe and would make it again. It is brought to you by Foodista. From preparation to the plate, this recipe takes around <b>around 45 minutes</b>. If you have brown sugar, sugar, flour, and a few other ingredients on hand, you can make it. Taking all factors into account, this recipe <b>earns a spoonacular score of 47%</b>, which is solid. Similar recipes include <a href=\"https://spoonacular.com/recipes/wholemeal-steam-bun-665306\">Wholemeal Steam Bun</a>, <a href=\"https://spoonacular.com/recipes/wholemeal-apple-cinnamon-scones-122784\">Wholemeal Apple & Cinnamon Scones</a>, and <a href=\"https://spoonacular.com/recipes/wholemeal-spinach-potato-pies-223882\">Wholemeal spinach & potato pies</a>.",
