    "imageType": "jpg",
    "summary": "Smoked Salmon Eggs Benedict With Lemon Dill Hollandaise might be just the morn meal you are searching for. One serving contains <b>539 calories</b>, <b>41g of protein</b>, and <b>33g of fat</b>. For <b>$6.07 per serving</b>, this recipe <b>covers 41%</b> of your daily requirements of vitamins and minerals. This recipe from Foodista has 73 fans. A mixture of baby arugula, baby spinach, eggs, and a handful of other ingredients are all it takes to make this recipe so scrumptious. It is a good option if you're following a <b>pescatarian</b> diet. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 92%</b>. This score is amazing. Try <a href=\"https://spoonacular.com/recipes/smoked-salmon-dill-eggs-benedict-792620\">Smoked Salmon Dill Eggs Benedict</a>, <a href=\"https://spoonacular.com/recipes/smoked-salmon-eggs-benedict-596988\">Smoked Salmon Eggs Benedict</a>, and <a href=\"https://spoonacular.com/recipes/smoked-salmon-eggs-benedict-78735\">Smoked Salmon Eggs Benedict</a> for similar recipes.",
