    "summary": "If you want to add more <b>Mediterranean</b> recipes to your recipe box, Light Greek Lemon Chicken Orzo Soup might be a recipe you should try. One portion of this dish contains approximately <b>26g of protein</b>, <b>4g of fat</b>, and a total of <b>278 calories</b>. This recipe serves 8 and costs $2.37 per serving. It works best as a main course, and is done in roughly <b>30 minutes</b>. This recipe is liked by 1 foodies and cooks. It is brought to you by Foodista. If you have juice of lemon, ground thyme, carrots, and a few other ingredients on hand, you can make it. It is perfect for <b>Autumn</b>. It is a good option if you're following a <b>dairy free</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 86%</b>. This score is amazing. Similar recipes include <a href=\"https://spoonacular.com/recipes/light-lemon-chicken-orzo-soup-694908\">Light Lemon Chicken Orzo Soup</a>, <a href=\"https://spoonacular.com/recipes/greek-lemon-soup-with-chicken-and-orzo-494677\">Greek Lemon Soup with Chicken and Orzo</a>, and <a href=\"https://spoonacular.com/recipes/greek-lemon-chicken-soup-with-orzo-997979\">Greek Lemon Chicken Soup with Orzo</a>.",
