    "summary": "The recipe North Carolina-Style BBQ Pulled Pork is ready <b>in approximately 45 minutes</b> and is definitely an outstanding <b>gluten free</b> option for lovers of American food. One serving contains <b>232 calories</b>, <b>26g of protein</b>, and <b>5g of fat</b>. For <b>$1.57 per serving</b>, you get a main course that serves 12. Not a lot of people made this recipe, and 7 would say it hit the spot. If you have apple cider vinegar, brown sugar, celery salt, and a few other ingredients on hand, you can make it. To use up the water you could follow this main course with the <a href=\"https://spoonacular.com/recipes/watermelon-peach-slushies-507207\">Watermelon-Peach Slushies</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 60%</b>. This score is pretty good. Try <a href=\"https://spoonacular.com/recipes/north-carolina-style-pulled-pork-724477\">North Carolina Style Pulled Pork</a>, <a href=\"https://spoonacular.com/recipes/north-carolina-style-pulled-pork-458007\">North Carolina-Style Pulled Pork</a>, and <a href=\"https://spoonacular.com/recipes/north-carolina-style-bbq-pulled-pork-sandwiches-286627\">North Carolina-Style BBQ Pulled-Pork Sandwiches</a> for similar recipes.",
