    "instructions": "<ol><li>Prepare the rub:</li><li>Mix paprika, light brown sugar, celery and garlic salts, dry mustard, black pepper, onion powder and salt in a small bowl. Season the entire pork roast and cover overnight in the refrigerator.</li><li>Preheat the oven to 325F. Place the pork roast in a large, disposable aluminum roasting pan.</li><li>In a small bowl, mix together the melted butter and the liquid hickory smoke for the basting marinade. Pour the basting marinade over the pork and cover with aluminum foil. Cook for approximately 4 1/2 hours (or until the pork becomes tender enough to start \"pulling\" away, turning the pork every hour, and basting every 1/2 hour. Alternatively, cook pork over white hot coals, covered, for 3-3 1/2 hours, basting and turning frequently with basting marinade.</li><li>Transfer the pork roast to a cutting board. Drain the excess juices from the pan. Slice the pork roast and pull apart the meat (trimming the fat) and place back into roasting pan.</li><li>Prepare the BBQ sauce: In a large bowl, mix the cider vinegar, water, ketchup, dark brown sugar, salt, and red pepper flakes and pour over pulled pork, stirring to make sure all pork is covered; cover with aluminum foil.</li><li>Place pulled pork back into the oven (still at 325F) or in pan on grill and cook for 1 1/2 hours, stirring pork and BBQ every 30 minutes.</li></ol>",
