    "summary": "Sourdough Stuffing with Sage Sausage and Apples is a side dish that serves 8. One serving contains <b>427 calories</b>, <b>16g of protein</b>, and <b>22g of fat</b>. For <b>$2.06 per serving</b>, this recipe <b>covers 18%</b> of your daily requirements of vitamins and minerals. 9 people have made this recipe and would make it again. This recipe from Foodista requires sausage, butter, portabello mushrooms, and wine. From preparation to the plate, this recipe takes around <b>around 45 minutes</b>. It will be a hit at your <b>Thanksgiving</b> event. With a spoonacular <b>score of 50%</b>, this dish is good. Similar recipes include <a href=\"https://spoonacular.com/recipes/sourdough-stuffing-with-mushrooms-apples-sage-548500\">Sourdough Stuffing with Mushrooms, Apples, & Sage</a>, <a href=\"https://spoonacular.com/recipes/sourdough-stuffing-with-sausage-apples-and-golden-raisins-189312\">Sourdough Stuffing with Sausage, Apples, and Golden Raisins</a>, and <a href=\"https://spoonacular.com/recipes/chantrelle-sage-sourdough-stuffing-620834\">Chantrelle Sage Sourdough Stuffing</a>.",
