    "imageType": "jpg",
    "summary": "The recipe Easy Lemon Feta Greek Yogurt Dip is ready <b>in approximately 15 minutes</b> and is definitely an excellent <b>gluten free, primal, and vegetarian</b> option for lovers of Mediterranean food. This recipe serves 4 and costs $1.48 per serving. This hor d'oeuvre has <b>249 calories</b>, <b>8g of protein</b>, and <b>23g of fat</b> per serving. It is perfect for <b>The Super Bowl</b>. This recipe is liked by 252 foodies and cooks. A mixture of greek yogurt, lemon zest, pepper flakes, and a handful of other ingredients are all it takes to make this recipe so delicious. All things considered, we decided this recipe <b>deserves a spoonacular score of 54%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/yogurt-and-feta-dip-922123\">Yogurt and Feta Dip</a>, <a href=\"https://spoonacular.com/recipes/meyer-lemon-greek-yogurt-pound-cake-with-white-chocolate-greek-yogurt-topping-530873\">Meyer Lemon-Greek Yogurt Pound Cake with White Chocolate-Greek Yogurt Topping</a>, and <a href=\"https://spoonacular.com/recipes/greek-yogurt-and-feta-dip-168280\">Greek Yogurt and Feta Dip</a> for similar recipes.",
