    "summary": "You can never have too many main course recipes, so give Parmesan chicken nuggets a try. One serving contains <b>712 calories</b>, <b>24g of protein</b>, and <b>59g of fat</b>. For <b>$1.54 per serving</b>, this recipe <b>covers 20%</b> of your daily requirements of vitamins and minerals. 61 person have made this recipe and would make it again. If you have egg, butter, breadcrumbs, and a few other ingredients on hand, you can make it. To use up the black pepper you could follow this main course with the <a href=\"https://spoonacular.com/recipes/dr-pepper-cake-with-flour-cooked-frosting-539165\">Dr. Pepper Cake with Flour Cooked Frosting</a> as a dessert. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 65%</b>. This score is pretty good. Similar recipes include <a href=\"https://spoonacular.com/recipes/parmesan-chicken-nuggets-612524\">Parmesan Chicken Nuggets</a>, <a href=\"https://spoonacular.com/recipes/parmesan-chicken-nuggets-595220\">Parmesan Chicken Nuggets</a>, and <a href=\"https://spoonacular.com/recipes/parmesan-chicken-nuggets-410469\">Parmesan Chicken Nuggets</a>.",
