    "summary": "Slow Cooker Baked Potato Soup might be just the main course you are searching for. One serving contains <b>618 calories</b>, <b>25g of protein</b>, and <b>29g of fat</b>. For <b>$1.89 per serving</b>, this recipe <b>covers 25%</b> of your daily requirements of vitamins and minerals. 991 person have made this recipe and would make it again. It can be enjoyed any time, but it is especially good for <b>Autumn</b>. If you have water, onion, baking potatoes, and a few other ingredients on hand, you can make it. To use up the bacon bits you could follow this main course with the <a href=\"https://spoonacular.com/recipes/blueberry-buckle-51636\">Blueberry Buckle</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 80%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/slow-cooker-baked-potato-soup-569219\">Slow cooker baked potato soup</a>, <a href=\"https://spoonacular.com/recipes/slow-cooker-baked-potato-soup-731389\">Slow Cooker Baked Potato Soup</a>, and <a href=\"https://spoonacular.com/recipes/slow-cooker-loaded-baked-potato-soup-264744\">Slow-Cooker Loaded Baked Potato Soup</a> for similar recipes.",
