    "instructions": "<p>Step 1: Coat the cubed potatoes with the flour and then place in the slow cooker.</p><p>Step 2: Add red onion, bouillon cubes, bacon bits, and pepper over the potatoes.</p><p><ins><ins><ins><iframe width=\"320\" height=\"100\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" vspace=\"0\" hspace=\"0\" allowtransparency=\"true\" scrolling=\"no\" allowfullscreen=\"true\" id=\"aswift_0\" name=\"aswift_0\" style=\"max-width: 100%; left: 0px; position: absolute; top: 0px;\"></iframe></ins></ins></ins></p><p>Step 3: Pour water over the mixture and cook on low for 8 hours.</p><p>Step 4: Add half-and-half, stirring well, and cook for another 30 minutes to thicken.</p><p>Step 5: Ladle soup into bowls and serve topped with green onion tops, cheddar cheese, and sour cream.</p>",
