    "summary": "Semi Ripe Plantain Pottage is a <b>caveman, gluten free, dairy free, and primal</b> main course. This recipe serves 2 and costs $2.99 per serving. One serving contains <b>580 calories</b>, <b>23g of protein</b>, and <b>3g of fat</b>. A mixture of cooking spoon of scent leaves, shrimp, vegetables, and a handful of other ingredients are all it takes to make this recipe so flavorful. To use up the palm oil you could follow this main course with the <a href=\"https://spoonacular.com/recipes/triple-chocolate-dairy-free-brownie-cookies-250160\">Triple Chocolate Dairy-Free Brownie Cookies</a> as a dessert. 272 people have tried and liked this recipe. From preparation to the plate, this recipe takes about <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 96%</b>. This score is excellent. Try <a href=\"https://spoonacular.com/recipes/mixed-vegetables-in-coconut-milk-with-semi-ripe-mangoes-478379\">Mixed vegetables in coconut milk — with semi-ripe mangoes</a>, <a href=\"https://spoonacular.com/recipes/aborrajados-de-pltano-ripe-plantain-fritters-226579\">Aborrajados de Plátano (Ripe Plantain Fritters)</a>, and <a href=\"https://spoonacular.com/recipes/envueltos-de-pltano-maduro-ripe-plantain-wraps-470357\">Envueltos de Plátano Maduro (Ripe Plantain Wraps)</a> for similar recipes.",
