    "summary": "Caramelized Tofu & Galan Apple Salad is a <b>gluten free and vegetarian</b> main course. For <b>$2.47 per serving</b>, this recipe <b>covers 13%</b> of your daily requirements of vitamins and minerals. One serving contains <b>344 calories</b>, <b>16g of protein</b>, and <b>17g of fat</b>. A few people made this recipe, and 13 would say it hit the spot. A mixture of galan apple, butter, extra-firm tofu, and a handful of other ingredients are all it takes to make this recipe so yummy. To use up the water you could follow this main course with the <a href=\"https://spoonacular.com/recipes/watermelon-peach-slushies-507207\">Watermelon-Peach Slushies</a> as a dessert. From preparation to the plate, this recipe takes about <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 51%</b>. This score is pretty good. Try <a href=\"https://spoonacular.com/recipes/gala-apple-cider-47795\">Galan Apple Cider</a>, <a href=\"https://spoonacular.com/recipes/roasted-pumpkin-gala-apple-garam-masala-soup-556663\">Roasted Pumpkin, Galan Apple & Garam Masala Soup</a>, and <a href=\"https://spoonacular.com/recipes/gala-crab-salad-403702\">Gala Crab Salad</a> for similar recipes.",
