    "id": 716367,
    "title": "Vanilla Pound Cake",
    "readyInMinutes": 75,
    "servings": 10,
    "sourceUrl": "http://www.afrolems.com/2013/08/06/pound-cake-nigerian-cake/",
    "image": "https://spoonacular.com/recipeImages/716367-556x370.jpg",
    "imageType": "jpg",
    "summary": "Vanilla Pound Cake might be just the dessert you are searching for. This recipe serves 10 and costs 68 cents per serving. One serving contains <b>337 calories</b>, <b>6g of protein</b>, and <b>16g of fat</b>. A few people made this recipe, and 36 would say it hit the spot. If you have flour, salt, eggs, and a few other ingredients on hand, you can make it. It is a good option if you're following a <b>vegetarian</b> diet. From preparation to the plate, this recipe takes roughly <b>1 hour and 15 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 29%</b>. This score is not so super. Try <a href=\"https://spoonacular.com/recipes/vanilla-sour-cream-pound-cake-with-vanilla-glaze-66408\">Vanilla & Sour Cream Pound Cake With Vanilla Glaze</a>, <a href=\"https://spoonacular.com/recipes/lcd-vanilla-pound-cake-66385\">LCD” Vanilla Pound Cake</a>, and <a href=\"https://spoonacular.com/recipes/vanilla-pound-cake-913933\">Vanilla Pound Cake</a> for similar recipes.",
